/*Table structure for table `gv_seriesproducto` */

DROP TABLE IF EXISTS `gv_seriesproducto`;

CREATE TABLE `gv_seriesproducto` (
  `idsp` bigint(20) NOT NULL AUTO_INCREMENT,
  `idproducto` bigint(20) NOT NULL,
  `idcliente` bigint(20) DEFAULT NULL,
